import React, {useEffect} from "react";
import API from "../utils/API";
import { Link } from "react-router-dom";
import { useStoreContext } from "../utils/GlobalState";
import { LOADING, SET_CURRENT_USER } from "../utils/actions";

function NavTabs() {

  const [state, dispatch] = useStoreContext();

  useEffect(() => {
    dispatch({ type: LOADING });
    API.logout(props.match.params.id)
      .then(user => dispatch({ type: CLEAR_CURRENT_USER, user }))
      .catch(err => console.log(err));
  }, []);

  //   API.logout()
  //     .then(res =>
  //     )
  //     .catch(err => console.log(err));
  // })

  return (
    <ul className="nav nav-tabs">
      <li className="nav-item">
        <a href="/logout" className={window.location.pathname === "/logout" ? "nav-link active" : "nav-link"}>
          logout
        </a>
      </li>
    </ul>
  );
}

export default NavTabs;
